(self.webpackChunkblog=self.webpackChunkblog||[]).push([[2502],{12502:n=>{n.exports="### 思路\n\n动态规划, 当前位置的数字, 等于当前位置左边的数字 + 当前位置上边的数字。\n\n### Analyze\n\n```js\nconst cache = {}\n/**\n * @param {number} m\n * @param {number} n\n * @return {number}\n */\nvar uniquePaths = function (m, n) {\n  if (m === 1 || n === 1) {\n    return 1\n  }\n\n  if (cache[`${m}~${n}`]) {\n    return cache[`${m}~${n}`]\n  } else {\n    const nums = uniquePaths(m - 1, n) + uniquePaths(m, n - 1)\n    cache[`${m}~${n}`] = nums\n\n    return nums\n  }\n}\n```"}}]);